import React, { Component } from 'react'
import axios from 'axios';

class People extends Component {

  componentDidMount() {
    this.showAllUsers()
  }
  showAllUsers = () => {
    axios.get('http://localhost:5000/api/users/allUsers')
      .then(res => {
        console.log(res)
      }).catch(err => console.log(err))
  }
  render() {
    return (
      <div>
        In People component
      </div>
    )
  }
}

export default People;
